/* eslint-disable react/react-in-jsx-scope */
import './App.css';
import {
  BrowserRouter as Router, Route, Switch, Link,
} from 'react-router-dom';

import NavBar from './components/NavBar';
import Home from './views/Home';
import Committee from './views/Committee';

function App() {
  return (
    <div>
      <NavBar />
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/committee">About</Link>
          </li>
        </ul>
      </nav>
      <Router>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route exact path="/committee">
            <Committee />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
